export default function list(info) {
  console.log(info);
  info.map((x) => {
    return (
      <ul>
        <li>
          <div className="flex">
            <img src={x.img} alt="img" />
            <div className="title">
              <h3 className="name">{x.name}</h3>
              <h5 className="age">{x.birthday}</h5>
            </div>
          </div>
        </li>
      </ul>
    );
  });
}
